import React from 'react'

export default class TempoContainer extends React.Component {

  render() {
    return (
      <div className="TempoContainer">
        <div className="Tempo">TEMPO</div>
        <div className="BPM">{this.props.bpm}</div>
      </div>
    )
  }

}
